let filterSer = AwFilterService.instance;



/*
render function
*/
import { uiViewRenderFunction } from 'js/UiViewService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/UiViewService', () => import('js/UiViewService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "uiViewRenderFunction",
            "deps": "js/UiViewService"
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "sub-panel-context": {
            "type": "object"
        }
    },
    "_viewModelId": "UiView",
    "_uniqueViewModelId": "UiView",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, uiViewRenderFunction, undefined, ctxImportObj );

export default Component;
